import {
    Chart,
    ChartSeries,
    ChartSeriesItem
} from '@progress/kendo-react-charts';


const ChartContainer = ({seriesData}) => (
    <Chart>
        <ChartSeries>
            <ChartSeriesItem data={seriesData} />
        </ChartSeries>
    </Chart>
);

export default ChartContainer;
